    // ---------------------------------------- PUBLIC -----------------------------------------------
    #[aztec(public)]
    internal fn _initialize(
        new_admin: AztecAddress,
        initial_liquidity: Field
    ) {
        storage.admin.write(new_admin);
        let initial = SafeU120::new(initial_liquidity);
        storage.liquidity.write(initial);
    }

    // #[aztec(private)]
    // fn close_position(

